import React, { useState } from "react"; 
import { auth, provider, signInWithPopup, signOut } from "../firebase";
import { useNavigate } from "react-router-dom"; // Import useNavigate

const GoogleLogin = () => {
  const [user, setUser] = useState(null);
  const navigate = useNavigate(); // Initialize navigation

  // ðŸ”¹ Handle Google Sign-In
  const signInWithGoogle = async () => {
    try {
      const result = await signInWithPopup(auth, provider);
      setUser(result.user);
      alert(`Welcome ${result.user.displayName}`);

      // âœ… Pass user data when navigating to HealthCard
      navigate("/healthcard", {
        state: {
          cardData: {
            snfNo: "97/2024",
            phone: result.user.phoneNumber || "N/A",
            cardNo: "HC123456",
            date: new Date().toLocaleDateString(),
            cardHolderName: result.user.displayName,
            address: "60 Feet Road, Narasaraopet, Palnadu Dist, A.P",
            mobile: result.user.phoneNumber || "N/A",
            familyDetails: ["Alice Doe", "Bob Doe"], // Example family members
          },
        },
      });

    } catch (error) {
      console.error("Google Sign-In Error:", error.message);
    }
  };

  // ðŸ”¹ Handle Logout
  const handleLogout = async () => {
    try {
      await signOut(auth);
      setUser(null);
      alert("Logged out successfully!");
    } catch (error) {
      console.error("Logout Error:", error.message);
    }
  };

  return (
    <div style={styles.container}>
      {user ? (
        <div style={styles.profile}>
          <img src={user.photoURL} alt="Profile" style={styles.avatar} />
          <h3>{user.displayName}</h3>
          <p>{user.email}</p>
          <button onClick={handleLogout} style={styles.button}>Logout</button>
        </div>
      ) : (
        <button onClick={signInWithGoogle} style={styles.button}>
          Sign in with Google
        </button>
      )}
    </div>
  );
};

// ðŸ”¹ Inline CSS for styling
const styles = {
  container: { textAlign: "center", marginTop: "50px" },
  button: { backgroundColor: "#4285F4", color: "white", padding: "10px 20px", fontSize: "16px", border: "none", borderRadius: "5px", cursor: "pointer" },
  profile: { marginTop: "20px", padding: "20px", border: "1px solid #ccc", borderRadius: "10px", display: "inline-block" },
  avatar: { width: "100px", borderRadius: "50%" },
};

export default GoogleLogin;
